import React from "react";

const earth= React.forwardRef((props, ref) => {
    return <div>
        <img ref={ref} id={"earth"} src="/Icons/Landscape/earth.png" style={{ width: "100%", height: "100%" }}/>
    </div>
});
export default earth;
